INSERT INTO `noticias` (`idnoticia`, `titulo`, `contenido`, `fecha`, `foto`) VALUES
(2, '\"España, País Invitado de Honor en el Salón Internacional de la Edición y del Libro de Casablanca 2019\"', 'España, País Invitado de Honor en el Salón Internacional de la Edición y del Libro de Casablanca 2019\r\n\r\nEspaña participará como País Invitado de Honor en la vigésimo quinta edición del Salón Internacional de la Edición y del Libro (SIEL) que tendrá lugar, del 7 al 17 de febrero, en Casablanca, según ha informado el Ministerio de Cultura. Se trata de una ocasión para promover el conocimiento y la presencia de la literatura española en Marruecos, así como para afianzar los vínculos y el diálogo cultural entre los dos países. España, País Invitado de Honor en el Salón Internacional de la Edición y del Libro de Casablanca 2019\r\n\r\nCon motivo de esta invitación, el ministerio, a través de la Dirección General del Libro y el Fomento de la Lectura y de Acción Cultural Española (AC/E), y el Ministerio de Asuntos Exteriores, a través del Instituto Cervantes y de la Embajada de España en Marruecos, han organizado un programa de actividades bajo el lema \'El viaje de las lenguas\', en el que además de la literatura española actual, estará muy presente la relación, histórica y actual, entre los dos países y sus culturas.', '2018-08-07', );
INSERT INTO `noticias` (`idnoticia`, `titulo`, `contenido`, `fecha`, `foto`) VALUES
(3, '\'¡Universo!\', de Albert Monteys, mejor cómic nacional de 2018', 'Las librerías especializadas integradas en Zona Cómic han elegido \'¡Universo!\', de Albert Monteys y editado por Astiberri, como el mejor cómic nacional publicado durante 2018, según ha informado la Confederación Española de Gremios y Asociaciones de Libreros (Cegal).\r\n\r\n\'¡Universo!\', que se publicó en abril de 2018, ha sido elegido tras obtener el mayor número de votos en un proceso en el que han quedado finalistas \'El tesoro del Cisne Negro\', de Paco Roca y Guillermo Corral (Astiberri); y \'Private Eye\', de Brian K. Vaughan, Marcos Martín y Muntsa Vicente (Ediciones Gigamesh).\r\n\r\nLa entrega del premio, que otorga Zona Cómic-Cegal en colaboración con el Ministerio de Cultura y Deporte, tendrá lugar el 22 de febrero en la librería Nexus-4 de Santander. El premio consiste en un trofeo exclusivo realizado por el escultor Marco Navas.\r\n\r\n', '2018-09-04', );
INSERT INTO `noticias` (`idnoticia`, `titulo`, `contenido`, `fecha`, `foto`) VALUES
(5, '¿Sabíais de la existencia de una biblioteca de magia?', 'La magia siempre ha sido un tema recurrente sobre todo para los libros de fantasía y ficción, y en el tema cinematográfico, si es un ámbito mucho más tocado y actual. Pero, ¿sabíais de la existencia de una biblioteca de magia? Yo no…. Al menos hasta hace unos días.\r\n\r\nLa biblioteca de magia de la que os hablamos se encuentra en Manhattan y contiene libros bastante raros. Otro dato curioso y que llama mucho al atención, es que sólo se puede acceder a ella mediante cita previa… Si queréis saber más sobre qué trata y qué libros podemos encontrar en ella, sigue leyendo un poco más abajo.', '2018-11-08', );

